import { Modal as AntModal } from 'antd';
import styled from 'styled-components';

const StyledAntModal = styled(AntModal)`
  .ant-modal-body{
    padding-bottom: 0px !important;
  }
  .ant-btn-primary {
    background: red;
  }
`;
export default StyledAntModal;
